//import React, { Component } from 'react';
//import { useState } from 'react';

import { Helmet } from 'react-helmet';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome"
import { faCode } from "@fortawesome/free-solid-svg-icons";
const discord = require('./icons/discord.png')
const youtube = require('./icons/youtube.png')
const github = require('./icons/github.png')
const python = require('./icons/python.png')
const java = require('./icons/java.png')
const c = require('./icons/c.png')
const mongodb = require('./icons/mongodb.png')
const sql = require('./icons/sql.png')


function Counter() { 
        return (
            <div className='bg-noob bg-no-repeat w-screen h-screen bg-cover'>
                <Helmet>
                    <title>Immortal</title>
                </Helmet>
                <nav className='items-center justify-center flex bg-black'>
                <div className = 'w-screen bg-black'><img src="https://yt3.ggpht.com/O7xWSERBTINGYA4zSsh2dr-Bwv0PWqWZp93RXncsJa1yaWJ8ZcX9FxuZ6dqt3n-3wXCIz0C3BA=s600-c-k-c0x00ffffff-no-rj-rp-mo" alt="Girl in a jacket" width="500" height="600" className='w-20 h-20 bg-black'></img></div>
                <h1 className='font-par w-full bg-black text-emerald-300 text-3xl px-5 text-center'>About me</h1>
                <h1 className='font-par w-full bg-black text-emerald-300 text-3xl px-5 text-center'>My Best Work</h1>
                <h1 className='font-par w-full bg-black text-emerald-300 text-3xl px-5 text-center'>        </h1>
                </nav>
                <h1 className='font-suk text-emerald-300 text-6xl text-center '>Hey there, I'm Ansh!</h1>
                <p className= 'font-par text-center py-5'>I am a <h3 className='inline text-emerald-600'>full stack developer</h3>.I have made many minecraft plugins,Discord Bots, Arduino Projects,Websites,etc.
                    <br/>My main languages are Python, Java and I have worked with MongoDB,SQL,etc.
                </p>
                <div className='text-center my-9'>
                    <a className = 'tooltip tooltip-bottom' data-tip='Join my server!' href='https://discord.gg/gqp5nMzwTY' target='_blank' rel="noreferrer"><img src={discord} alt='discord' className='hover:scale-110 w-20 h-20 mx-4'/></a>
                    <a className = 'tooltip tooltip-bottom' data-tip='Check out my channel!' href='https://www.youtube.com/channel/UCgppWM8JtpTfEYp8sa8XHEw' target='_blank' rel="noreferrer"><img src={youtube} alt='discord' className='hover:scale-110 w-20 h-20 mx-4'/></a>
                    <a className = 'tooltip tooltip-bottom' data-tip='See my projects!' href='https://github.com/Immortal-youtube' target='_blank' rel="noreferrer"><img src={github} alt='discord' className='hover:scale-110 w-20 h-20 mx-4'/></a>
                    <a className = 'tooltip tooltip-bottom' data-tip='Download Python!' href='https://www.python.org' target='_blank' rel="noreferrer"><img src={python} alt='discord' className='hover:scale-110 w-20 h-20 mx-4'/></a>
                    <a className = 'tooltip tooltip-bottom' data-tip='Download Java!' href='https://www.java.com/en/' target='_blank' rel="noreferrer"><img src={java} alt='discord' className='hover:scale-110 w-20 h-20 mx-4'/></a>
                    <a className = 'tooltip tooltip-bottom' data-tip='Checkout C++!' href='https://en.wikipedia.org/wiki/C%2B%2B' target='_blank' rel="noreferrer"><img src={c} alt='discord' className='hover:scale-110 w-20 h-20 mx-4'/></a>
                    <a className = 'tooltip tooltip-bottom' data-tip='Download MySQl!' href='https://www.mysql.com' target='_blank' rel="noreferrer"><img src={sql} alt='discord' className='hover:scale-110 w-20 h-20 mx-4'/></a>
                    <a className = 'tooltip tooltip-bottom' data-tip='Checkout MongoDB!' href='https://www.mongodb.com' target='_blank' rel="noreferrer"><img src={mongodb} alt='discord' className='hover:scale-110 w-20 h-20 mx-4'/></a>
                </div>
                <h2 className='font-par flex-auto px-5 '>On going Projects:
                    <br/> <FontAwesomeIcon icon={faCode} /> Computer Vision based Cube Solver(Kociemba's Algorithm)
                    <br/> <FontAwesomeIcon icon={faCode} /> Updating Discord bot  
                    <br/> <FontAwesomeIcon icon={faCode} /> Voice Assistant using ChatGPT
                </h2>
                <h2 className='font-par flex-auto pt-5 px-5'>
                    You can connect with me on Discord or on :<br/> <h2 className='text-emerald-300'>immortal.gaming0808@gmail.com</h2>
                </h2>
            </div>
        );
        
    
}
 
export default Counter;
